-- ----------------------------
-- Table structure for change_sheet
-- ----------------------------
DROP TABLE IF EXISTS `change_sheet`;
CREATE TABLE `change_sheet` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(255) DEFAULT '' COMMENT '变动单名称，格式为2018年12月变动单',
  `year` int(255) DEFAULT '2018' COMMENT '年份',
  `month` int(255) DEFAULT '1' COMMENT '月份',
  `yearmonth_string` varchar(255) DEFAULT '2018年1月' COMMENT '年月的字符串类型，用于接受前端日期数据',
  `yearmonth_int` int(255) DEFAULT '201801' COMMENT '年份和月份的组合，用于查询统计',
  `comment` varchar(500) DEFAULT '' COMMENT '备注',
  `process_status` varchar(255) DEFAULT '' COMMENT '流程状态，审批节点名称、已结束',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='变动单';

-- ----------------------------
-- Records of change_sheet
-- ----------------------------

