-- Table structure for change_sheet_annotation
-- ----------------------------
DROP TABLE IF EXISTS `change_sheet_annotation`;
CREATE TABLE `change_sheet_annotation` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `task_id` varchar(255) DEFAULT '' COMMENT '流程表中的taskId',
  `annotation` varchar(300) DEFAULT '' COMMENT '领导批注',
  `button_name` varchar(255) DEFAULT '' COMMENT '弹出框的操作按钮',
  `change_sheet_id` bigint(20) DEFAULT '0' COMMENT '关联change_sheet表的id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='变动单审批时的领导批注';

-- ----------------------------
-- Records of change_sheet_annotation
-- ----------------------------

-- ----------------------------
-- Table structure for change_sheet_attachment
-- ----------------------------
DROP TABLE IF EXISTS `change_sheet_attachment`;
CREATE TABLE `change_sheet_attachment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `year` int(255) DEFAULT '2018' COMMENT '年份',
  `month` int(255) DEFAULT '1' COMMENT '月份',
  `user_name` varchar(255) DEFAULT '' COMMENT '上传人',
  `file_name` varchar(255) DEFAULT '' COMMENT '上传的文件名',
  `path` varchar(255) DEFAULT '' COMMENT '文件的物理路径',
  `comment` varchar(500) DEFAULT '' COMMENT '备注',
  `sort` double(10,2) DEFAULT '0.00' COMMENT '排序',
  `operate_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '操作时间',
  `t_name` varchar(255) DEFAULT '' COMMENT '值为sal_np、sal_ltx',
  `change_sheet_id` bigint(20) DEFAULT '0' COMMENT '对应change_sheet表的id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='变动单中的工资的批量修改的附件';

