  `year` int(255) DEFAULT '2018' COMMENT '年份',
  `month` int(255) DEFAULT '1' COMMENT '月份',
  `name` varchar(255) DEFAULT '' COMMENT '过节费、奖金,sal_bonus表的name',
  `money` double(10,2) DEFAULT '0.00' COMMENT '总金额',
  `comment` varchar(500) DEFAULT '' COMMENT '备注',
  `sort` double(10,2) DEFAULT '0.00' COMMENT '排序',
  `change_sheet_id` bigint(20) DEFAULT '0' COMMENT '对应change_sheet表的id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='变动单-奖金或过节费，来源于内聘和退休';

