DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(255) DEFAULT '' COMMENT '姓名',
  `pwd` varchar(255) DEFAULT '' COMMENT '登录密码',
  `num` varchar(255) NOT NULL DEFAULT '' COMMENT '职工编号',
  `category` varchar(255) DEFAULT '' COMMENT '职工类别，具体查看sys_dic表',
  `id_num` varchar(255) DEFAULT '' COMMENT '身份证号码',
  `mobile` varchar(255) DEFAULT '' COMMENT '手机号',
  `bank_account` varchar(255) DEFAULT '' COMMENT '银行账号',
  `status` varchar(255) DEFAULT '正常' COMMENT '使用状态，正常和禁用',
  `job` varchar(255) DEFAULT '' COMMENT '在职状态',
  `give_mode` varchar(255) DEFAULT '' COMMENT '工资发放方式，包括站发、院发',
  `sort` double(10,2) DEFAULT '0.00' COMMENT '根据该字段进行排序显示',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `dept_id` int(11) DEFAULT '0' COMMENT '关联部门的id,默认为0,即该人员没有设置部门',
  `dept_name` varchar(255) DEFAULT '' COMMENT '关联的部门名称',
  `org` varchar(255) DEFAULT '' COMMENT 'dept_id的顶级节点，即单位名称',
  `comment` varchar(500) DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `num` (`num`) USING BTREE,
  UNIQUE KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1651 DEFAULT CHARSET=utf8 COMMENT='人员信息表';

